import React, { useEffect, useState } from "react";
import './index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { FiShoppingCart } from "react-icons/fi";
import axios from "axios";

export default function Header(){
    const [count,setCount] = useState([]);
    const [userID,setUserID] = useState()
    const navigate = useNavigate();
    const [authstatus,setAuthStatus] = useState('logged out')
    const handlelogout = ()=>{
        localStorage.removeItem('data')
        navigate('/login')
    }
    const getdata = ()=>{
        const data = localStorage.getItem("data")
        if(data){
            const parseData = JSON.parse(data)
            console.log("data",parseData)
            setUserID(parseData.id)
        }
        
        
    }
    useEffect(()=>{
        getdata();
    })
    useEffect(()=>{
        console.log("id",userID)
    })
    const cartcount = async()=>{
        const response = await axios.post('http://127.0.0.1:8000/count/',{
            userID
        })
        console.log(response.data)
        try{
           
            setCount(response.data)
            
        }catch(error){
            console.log('error' , error)

        }
    }


   
    

    useEffect(()=>{
        const data = JSON.parse(localStorage.getItem('data'))
        
        
    if (data){
        setAuthStatus("logged in")
    }else{
        setAuthStatus('logged out')
    }
    
    // eslint-disable-next-line
    },[setAuthStatus])
    
    
    return(
        <div className="header">
            <div className="container">
            <div className="nav-bar">
                <img src="data:image/png;base64," alt="" />
                <ul className="nav-item">
                <button> <li className="nav-link"><Link to='/'>Home</Link></li></button>
                    <button><li className="nav-link">Products</li></button>
                    {authstatus === 'logged in' ?(
                        <button><li onClick={handlelogout} className="nav-link">Logout</li></button>
                    ):(
                        <button><li className="nav-link"><Link to='/login'>Login</Link></li></button>
                    )}
                    <li id="cart_btn" className="nav-link"><Link to='/cart'><FiShoppingCart /><i>{count}</i></Link></li>
                    </ul>
                   
            </div>
            </div>
        </div>
    )
}
